import cn from "classnames";
import s from "./style.module.css";

const Player: React.FC = () => {
  return (
    <div className={s.item}>
      <div className={s.item__wrapper}>
        <div className={s.item__top}>
          <ul className={s.info__breadcrumbs}>
            <li>Players /</li>
            <li>Greg Whittington</li>
          </ul>
        </div>
        <div className={s.item__content}>
          <div className={s.item__photo}></div>
          <div className={cn(s.item__info, s.info)}>
            <div className={s.info__title}>Greg Whittington #22</div>
            <ul className={s.info__list}>
              <li>
                <p className={s.info__name}>Position</p>
                <span className={s.info__desc}></span>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Player;
